%[text] # verifying self-shadowing function
%[text] 3角パッチに対しては計算できる．4角パッチへの対応はまた今度．．．

clc
clear
close all

const = orbitConst %[output:6d99d4e4]
%%
%[text] ## load object
sat = readSC('boxWing4.obj'); %[output:67d30d40]
sat.kappa = 0;
sat.Cd = 0.5;
sat.Cs = 0.5;
sat.Ca = 0.5;

size(sat.vertices) % nVertices %[output:87942822]
size(sat.faces) % nFaces %[output:880da534]

showSC(sat) %[output:9b331e04]
%%
%[text] ## parameters
sun = [0.8 -0.3 0.62]; % nominal sun vector
% sun = rand(1,3);
sun = sun./norm(sun);
sunDist = const.AU * 10^3; % m

sat = srpSimple(sat, sun, sunDist, const); % calc. SRP
tic
sat = selfShadow(sat, sun); % calc self shadowing %[output:0db0307e]
toc %[output:436ae4c2]
%%
%[text] ## show figures
figure(4460) %[output:2834a6d8]
hold on %[output:2834a6d8]
cb = colorbar; %[output:2834a6d8]
colormap bone %[output:2834a6d8]
% caxis([0 1e-7])

satFig = patch('Faces',sat.faces,'Vertices',sat.vertices); %[output:2834a6d8]
set(satFig, 'FaceColor', 'b'); %[output:2834a6d8]
set(satFig, 'FaceLighting','phong','EdgeLighting','phong'); %[output:2834a6d8]
set(satFig, 'FaceVertexCData', sat.shadowFlag, 'FaceColor', 'flat') %[output:2834a6d8]

axis equal %[output:2834a6d8]
grid on %[output:2834a6d8]
xlabel('X'),ylabel('Y'),zlabel('Z') %[output:2834a6d8]
view(130,30); %[output:2834a6d8]
quiver3(0, 0, 0, 3*sun(1),3*sun(2),3*sun(3) ,'r') % show sun direction %[output:2834a6d8]
%%
%[text] ## calculation for variable attitude
%[text] 
% atti = 0:10:80; % attitude angle , deg
% for i = 1:length(atti) DCM = ZYX2DCM(deg2rad(atti(i)), 0.0, 0.0)'; % NOTE: vector rotation sun_var = DCM * sun;
